-- Table structure for sys_user
-- ----------------------------
DROP TABLE IF EXISTS `sys_user`;
CREATE TABLE `sys_user` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `login_name` varchar(100) DEFAULT NULL COMMENT '唯一',
  `password` varchar(100) DEFAULT NULL COMMENT 'md5加密',
  `name` varchar(100) DEFAULT NULL,
  `mobile` varchar(100) DEFAULT NULL,
  `email` varchar(100) DEFAULT NULL,
  `photo` varchar(1000) DEFAULT NULL COMMENT '存储头像URL',
  `user_type` varchar(50) DEFAULT NULL,
  `login_ip` varchar(100) DEFAULT NULL,
  `login_date` datetime DEFAULT NULL,
  `login_flag` tinyint(4) DEFAULT '1' COMMENT '1:允许 0 不允许',
  `create_by` varchar(64) DEFAULT NULL,
  `create_date` datetime DEFAULT NULL,
  `update_by` varchar(64) DEFAULT NULL,
  `update_date` datetime DEFAULT NULL,
  `remarks` varchar(500) DEFAULT NULL,
  `is_delete` tinyint(4) DEFAULT '0' COMMENT '0:未删除，1：已删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=71 DEFAULT CHARSET=utf8;

